import "./Dapp.css";
import styled from "styled-components";
import { BunnyCard } from "./components/bunnyCard";
import { ConnectWallet } from "./components/ConnectWallet/ConnectWallet";

const ConnectWalletButton = styled.div`
    height: 42px;
    display: flex;
    display: flex;
    flex-direction: row;
    flex-direction: row;
    ustify-content: center;
    justify-content: center;
    align-items: center;
    align-items: center;
    border-radius: 18px;
    color: #c8c8c8;
    font-size: 13px;
    font-weight: 600;
    letter-spacing: 1.2px;
    text-align: center;
    background-color: #712d45;
    box-shadow: none;
`;

const AppContainer = styled.div`
  width: 100%;
  height: 100%;
  display: flex;
  align-items: center;
  justify-content: center;
  background-color: #0f0c0d;
`;

function App() {
  return (

    <AppContainer>


        <ConnectWalletButton />

      <BunnyCard />
    </AppContainer>
  );
}

export default App;
